import React, { useEffect, useState } from 'react';
import axios from 'axios';
import Header from '../components/header'; 
import Footer from '../components/footer';

const BpmList = () => {
  const [bpm, setBPM] = useState([]);

  useEffect(() => {
    const fetchBpm = async () => {
      try {
        const response = await axios.get('http://localhost:3000/bpm/getlist'); 
        setBPM(response.data.bpm); 
      } catch (error) {
        console.error('Error fetching Bpm List:', error);
      }
    };

    fetchBpm();
  }, []);

  return (
    <div> 
        <Header/>{}
        <div className="container mt-5">
        <br /><br />
        <h2 className="mb-4">Bpm List</h2>
        <table className="table table-dark table-striped">
            <thead>
            <tr>
                <th>Name</th>
                <th>Age</th>
                <th>IR Value</th>
                <th>BPM</th>
                <th>Average Beat</th>
                <th>Date</th>
            </tr>
            </thead>

            <tbody>
            {bpm.map(bpm => (
                <tr key={bpm._id}>
                <td>{bpm.name}</td>
                <td>{bpm.age}</td>
                <td>{bpm.irValue}</td>
                <td>{bpm.beatsPerMinute}</td>
                <td>{bpm.beatAvg}</td>
                <td>{new Date(bpm.timestamp).toDateString()}</td>
                </tr>
            ))}
            </tbody>
        </table>
        </div>
        <Footer/>
    </div>
  );
};

export default BpmList;
